      | 365262 -> { ItemTypeData.id= 365262; name= "Commando A/1-Series"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Interlaced with subframe wiring, the Amarr variant utilizes asymmetric power distribution to intelligently reroute power to the suit’s various subsystems as needed. This improved throughput allows light-class laser weaponry to draw from the suit’s power reserves to enhance the damage dealt.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365456 -> { ItemTypeData.id= 365456; name= "'Angerstar' Rail Rifle"; published= false; description= "Part of Kaalakiota’s Stahl line of weaponry, the rail rifle is a fast-firing precision weapon designed for field operations where penetrative power and range are paramount. Developed using the corporation’s proprietary microscale technology, the rail rifle solves oversaturation issues endemic to sustained fire electromagnetic weaponry.  However, its greater range and power are offset by a smaller magazine capacity and lower rate of fire than similarly classified weapons.    The foregrip design aids stabilization and remains cool to the touch even during prolonged discharge where the barrel can exceed mean operating temperatures. Featuring a reinforced subassembly and compact, heavy-barrel design, the rail rifle is the premier fully automatic microscale weapon available today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
