      | 367590 -> { ItemTypeData.id= 367590; name= "Militia Ion Pistol Blueprint"; published= false; description= "A ruthlessly efficient close-quarters weapon, the ion pistol fires charged plasma munitions that rupture shields and scorch armor. Each discharge is enveloped in an electrostatic sheath that reduces field distortion and increases stability. The improved dispersion and stopping power is not without drawbacks though, as the higher density of each slug generates excessive heat, enough to seize the weapon if the rate of fire is not carefully controlled.    By overriding internal temperature controls, the weapon can be overcharged to produce a focused, bulk discharge of sufficient lethality to instantly neutralize most soft targets. Caution is advised however, as each overcharged shot will shut down internal systems until the excess heat can be flushed from the weapon’s core."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 367687 -> { ItemTypeData.id= 367687; name= "APEX 'Spartan' Assault"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 367594; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
